window.bookSummaryJSON = "<p><b>Audible number-one best seller Peter Clines returns with a thrilling tale of the creature above - and the deadly threat below.</b> </p> <p>In the year 2243, the Moon belongs to the dead. </p> <p>The largest graveyard in the solar system, it was the perfect solution to the overcrowding and environmental problems that had plagued mankind for centuries. And the perfect place for Cali Washington to run away from her past. </p> <p>But when a mysterious meteor crashes into one of the Moon’s cemeteries, Cali and her fellow Caretakers find themselves surrounded by a terrifying enemy force that outnumbers them more than a thousand to one. An enemy not hindered by the lack of air or warmth or sustenance. </p> <p>An enemy that is already dead. </p> <p>Now Cali and her compatriots must fight to survive. Because if they don’t, everyone on the Moon may be joining the dead. </p> <p>And maybe everyone on Earth, too....</p>"; 
